import Cocoa
import Foundation

extension Config {
    static let printerFont: NSFont = {
        let data = Data(base64Encoded: fontDataBase64)!
        let provider = CGDataProvider(data: data as CFData)!
        let cgFont = CGFont(provider)!
        let font = CTFontCreateWithGraphicsFont(cgFont, Config.fontSize, nil, nil)
        return font
    }()
}

private let fontDataBase64 = """

"""
.trimmingCharacters(in: .whitespacesAndNewlines)
